import './Style.css';

function randomInt() {
    return Math.floor(Math.random*10)
}

function createQuestion() {
    let question = `${randomInt()} + ${randomInt()}`
    return (
        <h3>{question}</h3>
    )
}

export default function Main () {
    return (
        <div className="main">
            <button onClick={createQuestion}>New Question</button>
        </div>
    )
}
